import React from "react";
import axios from "axios";

function Gettingstarted() {
  const getStarted = () => {
    axios.get("http://localhost:4838/login");
  };
  const clientId = "7a425c1418574be68e2894d011cdeb13";
  const redirectUri = "https://localhost:3000/home";
  const scopes = "SCOPE_LIST";

  const authEndpoint = "https://accounts.spotify.com/authorize";
  const authUrl = `${authEndpoint}?client_id=${clientId}&redirect_uri=${redirectUri}&scope=${scopes}&response_type=code`;

  window.location = authUrl;

  return (
    <div>
      <div>Lets get you started </div>
      <button style={{ width: "40vw" }} onClick={getStarted}>
        Lets get a grove on
      </button>
    </div>
  );
}

export default Gettingstarted;
